import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import {FC, ReactElement} from "react";
import {ButtonField} from "../fieldComponents/ButtonField";



function createData(
    name: string,
    calories: number,
    fat: number,
    carbs: number,
    editAction: string,
    deleteAction: string,


) {
    return { name, calories, fat, carbs, editAction, deleteAction };
}

const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, "Edit", "Delete"),
    // createData('Ice cream sandwich', 237, 9.0, 37, <ButtonField  variant={"contained"} color={"warning"} textValue={"Edit"} onClick= "test"/> , <ButtonField  variant={"contained"} color={"danger"} textValue={"Delete"} onClick= "test"/> ),
    // createData('Eclair', 262, 16.0, 24, <ButtonField  variant={"contained"} color={"warning"} textValue={"Edit"} onClick= "test"/> , <ButtonField  variant={"contained"} color={"danger"} textValue={"Delete"} onClick= "test"/>),
    // createData('Cupcake', 305, 3.7, 67, <ButtonField  variant={"contained"} color={"warning"} textValue={"Edit"} onClick= "test"/>, <ButtonField  variant={"contained"} color={"danger"} textValue={"Delete"} onClick= "test"/>),
    // createData('Gingerbread', 356, 16.0, 49, <ButtonField  variant={"contained"} color={"warning"} textValue={"Edit"} onClick= "test"/>, <ButtonField  variant={"contained"} color={"danger"} textValue={"Delete"} onClick= "test"/>),
];

export const DataTable: FC = (): ReactElement =>{
    {
        return (
            <TableContainer component={Paper}>
                <Table sx={{minWidth: 650}} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>Dessert (100g serving)</TableCell>
                            <TableCell align="right">Calories</TableCell>
                            <TableCell align="right">Fat&nbsp;(g)</TableCell>
                            <TableCell align="right">Carbs&nbsp;(g)</TableCell>
                            <TableCell align="right">Actions</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {rows.map((row) => (
                            <TableRow
                                key={row.name}
                                sx={{'&:last-child td, &:last-child th': {border: 0}}}
                            >
                                <TableCell component="th" scope="row">
                                    {row.name}
                                </TableCell>
                                <TableCell align="right">{row.calories}</TableCell>
                                <TableCell align="right">{row.fat}</TableCell>
                                <TableCell align="right">{row.carbs}</TableCell>
                                <TableCell align="right">{row.editAction}</TableCell>
                                <TableCell align="right">{row.deleteAction}</TableCell>

                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        );
    }
}
